import React from "react";
import { UserTopItems } from "../interfaces/UserTopItems";

const ArtistList = (props: { artists: Array<UserTopItems> }) => {
  return (
    <div className="artist-list">
      {artists.items.map((artist: UserTopItems) => (
        <div key={artist.id} className="artist-card">
          <img
            src={artist.images[0]?.url}
            alt={artist.name}
            className="artist-image"
            width={artist.images[0]?.width}
            height={artist.images[0]?.height}
          />
          <h2>{artist.name}</h2>
          <p>
            <strong>Genres:</strong> {artist.genres.join(", ")}
          </p>
          <p>
            <strong>Followers:</strong>{" "}
            {artist.followers.total.toLocaleString()}
          </p>
          <p>
            <strong>Popularity:</strong> {artist.popularity}
          </p>
          <a
            href={artist.external_urls.spotify}
            target="_blank"
            rel="noopener noreferrer"
          >
            Listen on Spotify
          </a>
        </div>
      ))}
    </div>
  );
};

export default ArtistList;
